1-1. Warm-up で作成した Apex トリガを修正します。
AccountTrigger.trigger
trigger AccountTrigger on Account(before insert, before update) {
  switch on Trigger.operationType {
    when BEFORE_INSERT {
      for (Account account : Trigger.new) {
        // Action (1)
        account.Name = '[サンプル] ' + account.Name;
      }
    }
    when BEFORE_UPDATE {
    }
    when else {
    }
  }
}

1-2. アクション (2) を BEFORE_INSERT および BEFORE_UPDATE に追加します。
AccountTrigger.trigger
trigger AccountTrigger on Account(before insert, before update) {
  switch on Trigger.operationType {
    when BEFORE_INSERT {
      for (Account account : Trigger.new) {
        // Action (1)
        account.Name = '[サンプル] ' + account.Name;

        // Action (2)
        String customerPriority = '';
        switch on account.Rating {
          when 'Hot' {
            customerPriority = 'High';
          }
          when 'Warm' {
            customerPriority = 'Medium';
          }
          when 'Cold' {
            customerPriority = 'Low';
          }
          when else {
          }
        }
        account.CustomerPriority__c = customerPriority;
      }
    }
    when BEFORE_UPDATE {
      for (Account account : Trigger.new) {
        // Action (2)
        String customerPriority = '';
        switch on account.Rating {
          when 'Hot' {
            customerPriority = 'High';
          }
          when 'Warm' {
            customerPriority = 'Medium';
          }
          when 'Cold' {
            customerPriority = 'Low';
          }
          when else {
          }
        }
        account.CustomerPriority__c = customerPriority;
      }
    }
    when else {
    }
  }
}

